        React.createElement("path", { d: "M9 8.75a1.25 1.25 0 110 2.5 1.25 1.25 0 010-2.5z", fill: primaryFill }),
        React.createElement("path", { d: "M15 8.75a1.25 1.25 0 110 2.5 1.25 1.25 0 010-2.5z", fill: primaryFill }),
        React.createElement("path", { d: "M8.25 15a.75.75 0 000 1.5h7.5a.75.75 0 000-1.5h-7.5z", fill: primaryFill }),
